import React from "react";
import {
    Container,
    Row,
    Col,
    Card
} from 'react-bootstrap';

export default function PokeData(props) {

    return ( <
        Container className = "mt-2" >
        <
        Row >
        <
        Col xs = {
            5
        }
        md = {
            3
        } >
        <
        Card >
        <
        Card.Header >
        <
        h5 > {
            props.name
        } < /h5> <
        img src = {
            props.sprite
        }
        alt = {
            props.name
        } > < /img> <
        /Card.Header> <
        Card.Body >
        <
        h5 > Abilities < /h5> {
            props.abilities.map((ability, key) => ( <
                div key = {
                    key
                } >
                <
                span > {
                    ability.ability.name
                } < /span> <
                /div>
            ))
        } <
        h5 > Types < /h5> {
            props.types.map((type, key) => ( <
                div key = {
                    key
                } >
                <
                span > {
                    type.type.name
                } < /span> <
                /div>
            ))
        } <
        /Card.Body> <
        /Card> <
        /Col> <
        Col xs = {
            12
        }
        md = {
            6
        } >
        <
        Card >

        <
        /Card> <
        /Col> <
        /Row> <
        /Container>
    )
}
